{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/milymob/bellabeat-case-study-using-r?scriptVersionId=98105068\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"attachments":{"f06763e6-653e-4d81-b367-72e5149b2020.png":{"image/png":""}},"cell_type":"markdown","id":"29c25cff","metadata":{"papermill":{"duration":0.111482,"end_time":"2022-06-11T18:40:59.734667","exception":false,"start_time":"2022-06-11T18:40:59.623185","status":"completed"},"tags":[]},"source":["![image.png](attachment:f06763e6-653e-4d81-b367-72e5149b2020.png)"]},{"cell_type":"markdown","id":"84807585","metadata":{"papermill":{"duration":0.10738,"end_time":"2022-06-11T18:40:59.950211","exception":false,"start_time":"2022-06-11T18:40:59.842831","status":"completed"},"tags":[]},"source":["## About Bellabeat\n","A high-tech, wearable smart tracker company that specializes in beautifully designed products to be a functional accessory to all women. Urška Sršen and Sando Mur founded Bellabeat in 2013 with the hopes to inform and inspire women around the world by providing wearable, highly fashionable, smart tech to track activity, sleep, stress, reproductive health, and so much more. With Sršen's background in the arts, it became evident that one of the main focuses of Bellabeat would be to close the gap of the traditionally boxy, bulky, uninspiring designs of wearable tech that are littered all over the market.\n","\n","Bellabeat has focused distribution of their products through a growing number of online retailers in addition to their own e-commerce platform on their website. They have invested in traditional advertising media, such as print, television, radio, and out-of-home billboards, but focuses mainly on digital marketing through Google Search, display ads on the Google Display Network, YouTube ads, and maintaining active social media accounts across many platforms.\n","\n","\n","## Business Tasks\n","The goal of this Data Analytics project is to utilize smart device usage data to give the marketing team recommendations on how to push Bellabeat further into the wearable tech market and give the consumers a more favorable experience. The data we will be using to complete this project is the FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mobius). This Kaggle dataset contains the personal fitness tracker data on thirty FitBit users who have consented to the submission of their data. Some questions to keep in mind while diving into this analysis are the following:\n","\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat's marketing strategy?\n","\n","\n","## Process\n","Through this Data Project, you will see a clear outline of the steps I have used to reach the recommendations provided to the marketing team. You will see explanations of cleaning data, processes, analyses, and recommendations to make this project reproducible and understandable. I have provided visualizations throughout this project but will be sure to include them in the conclusion for easy visual reference. At the very end of the report is where you will be able to find a concise list of the trends I noticed through my analysis of this data and a conclusion of recommendations. I want to thank you for viewing my data project and would appreciate any feedback given. Enjoy!"]},{"cell_type":"markdown","id":"78802c79","metadata":{"_cell_guid":"74a1b979-9fec-4da4-a0df-d764417d2168","_uuid":"980a1f9f-137b-4cc2-a753-945f0e2cfd43","papermill":{"duration":0.109829,"end_time":"2022-06-11T18:41:00.16806","exception":false,"start_time":"2022-06-11T18:41:00.058231","status":"completed"},"tags":[]},"source":["**1. LOADING PACKAGES** \n","\n","to start, we will load the packages needed to complete this analysis"]},{"cell_type":"code","execution_count":1,"id":"d20db9f9","metadata":{"_cell_guid":"ab2d8eca-3fed-4283-b848-e2123058305b","_uuid":"802018bc-cb27-4cbe-9743-e12afb3d2353","collapsed":false,"execution":{"iopub.execute_input":"2022-06-11T18:41:00.395134Z","iopub.status.busy":"2022-06-11T18:41:00.392508Z","iopub.status.idle":"2022-06-11T18:41:02.202563Z","shell.execute_reply":"2022-06-11T18:41:02.201226Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.92274,"end_time":"2022-06-11T18:41:02.202739","exception":false,"start_time":"2022-06-11T18:41:00.279999","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: ggplot2\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4     \n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}],"source":["library(ggpubr)\n","library(tidyverse)\n","library