5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["daily_use_percentages %>% \n","  ggplot(aes(x=\"\", y=total_percent, fill=usage)) + \n","  geom_bar(stat = \"identity\", width = 7) +\n","  coord_polar(\"y\", start = 0) +\n","  theme_minimal() +\n","  theme(axis.title.x = element_blank(),\n","        axis.title.y = element_blank(),\n","        panel.border = element_blank(),\n","        panel.grid = element_blank(),\n","        axis.ticks = element_blank(),\n","        axis.text.x = element_blank(),\n","        plot.title = element_text(hjust = 0.5, size = 20, face = \"bold\")) +\n","  geom_text(aes(label = labels),\n","            position = position_stack(vjust = 0.5)) +\n","  scale_fill_manual(values = c(\"dodgerblue3\", \"darkturquoise\", \"paleturquoise1\"),\n","                    labels = c(\"High Usage (21-31 days)\", \"Moderate Usage (11-21 days)\", \"Low Usage (1-10 days)\")) +\n","  labs(title = \"Daily Usage Percentiles\")"]},{"cell_type":"markdown","id":"06f100ef","metadata":{"papermill":{"duration":0.180314,"end_time":"2022-06-11T18:41:26.231786","exception":false,"start_time":"2022-06-11T18:41:26.051472","status":"completed"},"tags":[]},"source":["**ANALYSIS:** we can see the half of our sample of users have high daily usage of their device, and the next biggest category of users are low users\n","\n","**RECOMMENDATION:** *to solve this, we can send a notification in the morning via our app to urge our users to put on their device for the day*"]},{"cell_type":"markdown","id":"bfcd53ff","metadata":{"papermill":{"duration":0.179192,"end_time":"2022-06-11T18:41:26.589883","exception":false,"start_time":"2022-06-11T18:41:26.410691","status":"completed"},"tags":[]},"source":["## Conclusion \n","\n","This analysis has given us an in-depth look into the thirty FitBit user's trends and habits. We were able to answer our business task questions. \n","\n","**Q.** *What are some important trends in smart device usage?*\n","\n","**A.**  USAGE: We were able to determine that 50% of our sample used their devices between 21 and 31 days per month. We also identified that our next biggest group of users were considered low usage, utilizing their device between 1 and 10 days per month. \n","\n","SLEEP: We shockingly discovered that on average none of our users met the recommended 480 minutes of sleep per night. This is concerning because of how important sleep is to human functionality. Upon a quick scan of the *daily_sleep* dataset, an abnormal number of logged values in the *total_minutes_asleep* column were around or below 300, translating into less than 5 hours of sleep per night. \n","\n","SEDENTARY MINUTES: We were able to determine that the users exceeded the recommended daily amount of sedentary minutes per day of 510 minutes. In the *Sedentary Minutes vs Minutes Asleep* we can see that a majority of data points are positioned between the 500-1000 marks on the graph, meaning that most of our users spend between 8-16.5 hours of their day being sedentary. \n","\n","\n","**Q.** *How can these trends apply to Bellabeat customers?*\n","\n","**A.** These findings can give Bellabeat the inside scoop as to where our competitors are falling short in providing their services to their customers. This can give us a leg up by providing a product that has solutions to potential problems consumers in the market are already facing, giving our customers a more favorable experience. \n","\n","\n","**Q.** *How could these trends help influence Bellabeat's marketing strategy?*\n","\n","**A.** We can take advantage of these findings by coming up with creative solutions to the issues that already seem to be plaguing consumers. We can use marketing strategies to leverage engagement and interest in the problems we see. \n","\n","## Recommendations\n","\n","1. Notifications: it seems that a lot of the users can improve their health and numbers with a friendly reminder from the Bellabeat app. \n","    * USAGE: Bellabeat can send a reminder notification to users to urge them to put on their device at the start of the day. If the Bellabeat device notices that no data has been collected for an extended period of time it can remind the user to put on their device to enhance the accuracy of their data readings.\n","    * SLEEP: Bellabeat can send a reminder notification to users to get to bed at the beginning of their sleep schedule that they outline in the app. Or send a reminder based on the trends of when the user is likely to go to sleep based on the data it has collected previously. \n","    * SEDENTARY MINUTES: Bellabeat can send a nudge notification encouraging its users to get up and move for at least one minute during their sedentary hours. This competitive style of notification will help decrease the number of sedentary minutes a user has in a day and increase the number of minutes asleep per day, as noted by the negative correlation outlined in the *Sedentary Minutes vs Minutes Asleep* visualization. We can also create a visually interesting goal system that is tangible for our users to achieve every day.\n","    \n","2. Battery: with the discrepancy in the *total_minutes_asleep* column in the *daily_sleep* datatable, it seems that users may be charging their devices during sleep hours or their devices are dying from a loss of battery power. We can make sure to provide a solution to this problem with extended battery life and performance and/or with shorter charging times. This will increase the convenience of Bellabeat products and ultimately aid in the collection of more accurate data. We can use the improvement of battery power as a strong marketing selling point to drive up engagement and interest in Bellabeat products. "]},{"attachments":{"6e21a30a-5643-4ba0-8f6a-3f1a7a8f4a63.png":{"image/png":""},"7beee9ab-eced-4e13-be37-58021b487ed5.png":{"image/png":""},"9682ba48-242f-49c9-9b47-d26309582a51.png":{"image/png":""},"a33e36a3-f78a-4665-b563-2cea083a321c.png":{"image/png":""},"aff8921d-e55b-4675-bafe-1da66dd48650.png":{"image/png":""},"fad47692-dcd0-4b58-a1d3-adc0f2f8dca6.png":{"image/png":""}},"cell_type":"markdown","id":"3a60761e","metadata":{"papermill":{"duration":0.178802,"end_time":"2022-06-11T18:41:26.949995","exception":false,"start_time":"2022-06-11T18:41:26.771193","status":"completed"},"tags":[]},"source":["## Visualizations\n","\n","![image.png](attachment:9682ba48-242f-49c9-9b47-d26309582a51.png)\n","\n","![image.png](attachment:7beee9ab-eced-4e13-be37-58021b487ed5.png)\n","\n","![image.png](attachment:a33e36a3-f78a-4665-b563-2cea083a321c.png)\n","\n","![image.png](attachment:6e21a30a-5643-4ba0-8f6a-3f1a7a8f4a63.png)\n","\n","![image.png](attachment:aff8921d-e55b-4675-bafe-1da66dd48650.png)\n","\n","![image.png](attachment:fad47692-dcd0-4b58-a1d3-adc0f2f8dca6.png)"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":30.769856,"end_time":"2022-06-11T18:41:27.246351","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-11T18:40:56.476495","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}